const Contact=()=>{
    return(
        <>
    <h1>contact us</h1>
    <form className="contact">
        <div>
            <label htmlFor="name">Name</label>
            <input type="text" placeholder="Enter" />
        </div>
    </form>
        </>
    )
}
export default Contact;
